        <div className='mainContainer'>
            <div className='mainframe'>
                <div className='searchbar'>
                    <input id='searchtopic' ></input>
                    <img src = {searchIcon} id ="searchIcon"></img>
                    <span>링크를 검색해 보세요</span>
                </div>
            </div>
        </div>
    )
}

export default main;
